column8:
全長34cm（チェーン部分23cm）のナスカンです。<br>
ケージのドアロックやおもちゃを接続したりと用途は色々!!<br><br>
・本体：鉄・亜鉛合金・クロームメッキ仕上げ<br>
・静対応重量：5kgまで<br>
<P>
キーワード：<BR>
KAWAI　ケージロック　脱走防止　<P>


関連商品：<BR>

